import React from 'react'
import "./App.css";
import Navbar from "./components/Navbar/Navbar";

function About() {
    return (
        <div className="about">
            <Navbar />
            <h2>About Notes app</h2>
            <p>Notes app i krijuar me ReactJS, Redux, ASP.NET Core per API</p>
        </div>
    )
}

export default About;
